let rocket = parcel.getFeatureById('KOUN0022')
let card = parcel.getFeatureById('KOUN0023')

let r1 = rocket.createAnimation('position')
r1.setKeys([{
  frame: 30,
  value: rocket.position.add( new Vector3(0,-0.23,0) )
}])

let r2 = rocket.createAnimation('position')
r2.setKeys([{
  frame: 60,
  value: rocket.position.add( new Vector3(0,0,0) )
}])

let r3 = card.createAnimation('position')
r3.setKeys([{
  frame: 30,
  value: card.position.add( new Vector3(0,-0.55,0) )
}])

let r4 = card.createAnimation('position')
r4.setKeys([{
  frame: 60,
  value: card.position.add( new Vector3(0,0,0) )
}])


let closed = true
feature.on('click',e=>{

if(closed){
     rocket.startAnimations( [r1] )
     card.startAnimations( [r3] )
  }else{

     rocket.startAnimations( [r2] )
     card.startAnimations( [r4] )

  }
closed=!closed


})

